(263, '2020-09-22 17:51:39', 'Piso 40', 107, 'Ejecutada', 'e_mantto_Montaje + Conexión eléctrica + Prueba funcional motor de extractor de aire (Lado izquierdo) en sala de máquinas', 18, 'Se ejecutó el montaje del motor eléctrico, se efectuaron las conexiones eléctricas, se probó sentido de giro y se le dió arranque de prueba al equipo se midió voltajes y amperajes en líneas L1-L2-L3 con los siguientes resultados (393-392-393)V y (1.84-1.82-1.825).\r\nEstá pendiente revisar un tornillo de los alabes que roza con parte metálica y evaluar tema vibración. Se termino de armar el ducto de ventilación de la sala de ascensores del piso 40, realizado por Neil López y Ricardo Linares. Se probo su funcionamiento dando de consumo en cada linea 2.65A ; 2.64A y 2.64A. Queda operativo', 0, 'mantto'),
