(170, 'Reporte de turno de 07hs hasta 16hs', '2020-09-23 18:06:51', 20, 'Se realizo limpieza de rutina de vereda, vidrio, espejos, pisos de ascensores, piso entrada pricipal al edificio.Limpieza de vestuario baños y palier del sum _2. se hace recorrido por la sla de bombas todo normal, nivel de agua en los tanque : lleno. Luces escalera y palier todo normal. se recibio un areosol de Ricardo Mujica para la limpieza y mantenimiento de la parte de acero inoxidable en el e', 8, 0, NULL),
(171, 'Entrega de turno nocturno (20:00 a 08:00)', '2020-09-23 20:00:04', 3, 'Miércoles 23 de Septiembre 2020', 9, 0, NULL),
